```json
{
  "application": "NWChem",
  "details": {
    "software": [
      "Intel 2013 compilers",
      "Intel MKL 2013 math library",
      "PGI",
      "OpenMPI-Intel local installation",
      "NWChem"
    ],
    "resources": {
      "nodes": 1,
      "CPUs": 12,
      "memory": "42GB",
      "walltime": "3-10:00:00",
      "partition": "compute",
      "scratch_directory": "/mnt/local/$USER/SLURMjob-${SLURM_JOBID}"
    }
  }
}
```

The script launches a NWChem calculation on a cluster using SLURM for resource allocation and management. It sets up a local scratch directory and utilizes Intel compilers, MKL math library, PGI, and OpenMPI-Intel for the calculation. The script also defines various job parameters like the number of nodes, CPUs, memory, walltime, and partition. Finally, it executes NWChem with the specified input file and saves the converged geometry to the home directory.
